import mongoose from 'mongoose';

const UserShema = new mongoose.Schema({
  name: {
    type: String,
    require: true,
  },
  email: {
    type: String,
    require: true,
  },
  createAt: {
    type: Date,
    default: Date.now(),
  },
});

export default mongoose.model('testUser', UserShema);
